AJ applegate, Veruca James, Christie Stevens, Layla Price, Will Powers, Mark Wood, Derrick Pierce, Tommy Gunn

These gorgeous office gals are filing you under 'A' for their favorite position! A hard day's work will make you horny, so it's good to know you've got an assistant that is totally anal! She's eager to prove that she runs a tight ship, bending over backwards to show you her hidden ass-ets! Give her the raise she craves and make sure you deliver it through the back door!

